import React from 'react';

export default function Dashboard({ history }) {
    function handleSubmit(e) {
        history.push('/produto');
    }

    return (
        <>
            <form onSubmit={handleSubmit}>
                <button type="submit">Produto</button>
            </form>
        </>
    )
}
